/**
 * Anchor smooth scrolling @ToDo funktioniert noch nicht auf der Startseite.
 */
(function () {
    document.addEventListener('DOMContentLoaded', function() {
        // Auswahl des Scroll-Buttons mittels der Klasse 'btn-scroll-top'
        const button = document.querySelector('.btn-scroll-top[data-scroll]');
        // Auswahl des fixierten Headers mittels seiner Klasse
        const header = document.querySelector('.navbar-sticky');

        if (!button) return; // Wenn der Button nicht gefunden wurde, beende die Ausführung

        button.addEventListener('click', function(e) {
            e.preventDefault(); // Verhindere das Standard-Link-Verhalten

            const headerHeight = header ? header.offsetHeight : 0; // Berechne die Höhe des fixierten Headers, falls vorhanden
            const scrollToPosition = 0 - headerHeight; // Ziehe die Header-Höhe von der Scroll-Position ab, falls notwendig

            // Glattes Scrollen zum Anfang der Seite unter Berücksichtigung des fixierten Headers
            window.scrollTo({
                top: scrollToPosition, // Angepasste Ziel-Position
                behavior: 'smooth' // Aktiviere das glatte Scrollen
            });
        });
    });
})();

/**
 * Animate scroll to top button in/off view
 */

(function () {
  document.addEventListener('DOMContentLoaded', () => {
    const element = document.querySelector('.btn-scroll-top');
    const scrollOffset = 600; // Keine Notwendigkeit für parseInt, da es bereits eine Zahl ist

    if (!element) return; // Frühzeitiger Ausstieg, wenn das Element nicht gefunden wurde

    window.addEventListener('scroll', () => {
      if (window.pageYOffset > scrollOffset) {
        element.classList.add('show');
      } else {
        element.classList.remove('show');
      }
    });
  });
})();


